    require(recipient != address(0), "Invalid recipient address");
    require(amount > 0, "Amount must be greater than zero");
    require(owner == msg.sender, "Sender is not the owner");
    require(owner == recipient, "Recipient is not the owner");
    require(tx.origin == owner, "Transaction origin is not the owner");

    address sender = msg.sender;
    uint8 senderStatus = 0x0f;
    require(!bytes1(storage_map_b[sender]), "Sender is restricted");

    sender = recipient;
